import React from "react";
import "./Root.css";

const picture =
  "https://upload.wikimedia.org/wikipedia/commons/b/bf/Pig_farm_Vampula_9.jpg";
const alt = "Picture of a pig";

function Root() {
  return (
    <div>
      <header>Nicolas Bonnet</header>
      <nav>
        <button>Home</button>
        <button>Search</button>
      </nav>
      <aside>
        <img src={picture} alt={alt} />
      </aside>
    </div>
  );
}

export default Root;
